INSERT INTO `mdl_scale` VALUES (1,0,0,'Будьте беспристрастным','Наиболее отделенные сообщения,Отделенные и связанные сообщения,Наиболее связанные сообщения','Шкала основана на теории независимого и связного познания. Эта теория описывает два различных способа изучения и оценки вещей, которые мы видим и о которых слышим.<ul><li>Те, кто познают мир <strong>независимо</strong>, остаются, насколько возможно, объективными без учета своих чувств и эмоций. В обсуждениях с другими людьми, у которых могут быть другие взгляды, им нравится защищать свои собственные идеи с использованием логики, чтобы найти слабые места в суждениях соперника. </li><li>Те же, кто познают мир <strong>связанно</strong> более восприимчивы к другим людям. Они умеют сопереживать и склонны слушать и задавать вопросы, пока не почувствуют, что нашли связь и начали «понимать вещи с другой точки зрения». Они учатся, пытаясь заимствовать опыт и знания, которые они находят в других людях. </li></ul>',0,1534931660),(2,0,0,'Шкала компетенции по умолчанию','Пока не соответствует требованиям,Соответствует требованиям','Двоичная шкала оценок, которая содержит информацию только о том, демонстрирует человек умение или нет.',0,1534931660);
/*!40000 ALTER TABLE `mdl_scale` ENABLE KEYS */;
